import React from "react";
import { Github, Linkedin, Twitter, Mail, ExternalLink, ShieldCheck, Heart } from "lucide-react";
import { motion } from "framer-motion";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  const socialLinks = [
    { icon: Github, url: "https://github.com/", label: "GitHub", color: "hover:bg-slate-800" },
    { icon: Linkedin, url: "https://linkedin.com/", label: "LinkedIn", color: "hover:bg-blue-600" },
    { icon: Twitter, url: "https://twitter.com/", label: "Twitter", color: "hover:bg-sky-500" },
    { icon: Mail, url: "mailto:info@collabryta.com", label: "Email", color: "hover:bg-rose-500" },
  ];

  const sections = [
    {
      title: "Product",
      links: [
        { name: "Features", url: "/features" },
        { name: "Integrations", url: "#" },
        { name: "Pricing", url: "#" },
        { name: "Changelog", url: "#" },
      ],
    },
    {
      title: "Company",
      links: [
        { name: "About Us", url: "/about" },
        { name: "Careers", url: "#" },
        { name: "Blog", url: "#" },
        { name: "Contact", url: "/support" },
      ],
    },
    {
      title: "Resources",
      links: [
        { name: "Documentation", url: "/docs" },
        { name: "Help Center", url: "/support" },
        { name: "Community", url: "#" },
        { name: "Privacy Policy", url: "#" },
      ],
    },
  ];

  return (
    <footer className="w-full bg-white border-t border-slate-200 pt-16 pb-8 px-4 sm:px-8 overflow-hidden relative">
      <div className="max-w-7xl mx-auto">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-12 mb-16">
          {/* Logo & Brand Info */}
          <div className="lg:col-span-2 space-y-6">
            <div className="flex items-center gap-3">
              <div className="p-2 bg-blue-600 rounded-xl shadow-lg shadow-blue-200">
                <img src="/logo1.png" alt="Logo" className="w-8 h-8 invert brightness-0" />
              </div>
              <h2 className="text-2xl font-bold tracking-tight text-slate-900">Collabryta</h2>
            </div>
            <p className="text-slate-500 text-sm leading-relaxed max-w-sm">
              The ultimate collaboration hub for modern teams. Build, manage, and scale your projects with AI-powered insights and seamless workflow automation.
            </p>
            <div className="flex items-center gap-3">
              {socialLinks.map(({ icon: Icon, url, label, color }) => (
                <motion.a
                  key={label}
                  href={url}
                  target="_blank"
                  rel="noopener noreferrer"
                  whileHover={{ y: -4 }}
                  className={`p-2.5 rounded-xl border border-slate-200 text-slate-500 hover:text-white ${color} transition-all duration-300 shadow-sm`}
                >
                  <Icon size={18} />
                </motion.a>
              ))}
            </div>
          </div>

          {/* Nav Sections */}
          {sections.map((section) => (
            <div key={section.title} className="space-y-6">
              <h3 className="text-sm font-bold uppercase tracking-wider text-slate-900">{section.title}</h3>
              <ul className="space-y-4">
                {section.links.map((link) => (
                  <li key={link.name}>
                    <a
                      href={link.url}
                      className="text-slate-500 text-sm hover:text-blue-600 hover:translate-x-1 inline-block transition-all"
                    >
                      {link.name}
                    </a>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>

        {/* Bottom Line */}
        <div className="pt-8 border-t border-slate-100 flex flex-col md:flex-row justify-between items-center gap-6">
          <div className="flex items-center gap-2 text-slate-400 text-xs font-medium">
            <ShieldCheck size={14} className="text-emerald-500" />
            <span>SSL Secured & GDPR Compliant</span>
          </div>

          <p className="text-slate-400 text-xs">
            Â© {year} <span className="text-slate-900 font-semibold italic">Collabryta Corp.</span> All rights reserved.
          </p>

          <div className="flex items-center gap-1.5 text-xs text-slate-400">
            <span>Made with</span>
            <Heart size={12} className="text-rose-500 fill-rose-500 animate-pulse" />
            <span>in World</span>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
